import React from 'react';
import './ByUser.css'
import UserIcon from '../ByStatus/UserIcon';

const ByUser = ({ tickets, users, sortOption }) => {
  const icons = {
    "Backlog" : <i class="fa-solid fa-spinner"></i>,
    "Todo" : <i class="fa-regular fa-circle"></i>,
    "In progress" : <i class="fa-solid fa-circle-half-stroke" style={{"color": "#e6e02d"}}></i>,
    "Done" : <i class="fa-solid fa-circle-check" style={{"color": "#1b52b1"}}></i>,
    "Canceled": <i class="fa-solid fa-ban" style={{"color": "#787878"}}></i>
  };
  const PriorityIcons = {
    "No Priority" : <i class="fa-solid fa-ellipsis" style={{"color": "#66686b"}}></i>,
    "Urgent" : <i class="fa-solid fa-triangle-exclamation" style={{"color": "#ff9500"}}></i>,
    "High": <i class="fa-solid fa-signal" style={{"color": "#00ff04"}}></i>,
    "Medium": <i class="fa-solid fa-signal" style={{"color": "#cf8800"}}></i>,
    "Low" : <i class="fa-solid fa-signal" style={{"color": "#ff0000"}}></i>
  }
  const groupTicketsByUser = () => {
    let groupedTickets = {};

    users.forEach((user) => {
      const userTickets = tickets.filter((ticket) => ticket.userId === user.id);
      if (userTickets.length > 0) {
        groupedTickets[user.id] = userTickets;
      }
    });

    return groupedTickets;
  };

  const sortedTickets = (tickets) => {
    if (sortOption === 'priority') {
      tickets.sort((a, b) => a.priority - b.priority);
    } else if (sortOption === 'title') {
      tickets.sort((a, b) => a.title.localeCompare(b.title));
    }
    return tickets;
  };

  const groupedByUser = groupTicketsByUser();


  Object.keys(groupedByUser).forEach((userId) => {
    groupedByUser[userId] = sortedTickets(groupedByUser[userId]);
  });


  const getNameFromUserId = (userId) => {
    const foundUser = users.find(user => user.id === userId);
    return foundUser ? foundUser.name : 'Unknown'; 
  };

  const getAvailableFromUserId = (userId) => {
    const foundUser = users.find(user => user.id === userId);
    return foundUser ? foundUser.available : false; 
  };

  const checkPriority = (priorityNumber)=>{
    if(priorityNumber===0) return PriorityIcons['No Priority'];
    else if(priorityNumber===1) return PriorityIcons['Low'];
    else if(priorityNumber===2) return PriorityIcons['Medium'];
    else if(priorityNumber===3) return PriorityIcons['High'];
    else return PriorityIcons['Urgent'];
  }



  return (
    <div className="ByUser">
      {Object.keys(groupedByUser).map((userId, index) => (
        <div key={index} className="ByUser-kanban-column">
          <div className='ticketUserNameandDpDiv'><UserIcon name={getNameFromUserId(userId)} isActive={getAvailableFromUserId(userId)} /><h3 style={{textAlign:"center"}}>{getNameFromUserId(userId)} {groupedByUser[userId].length}</h3></div>
          {groupedByUser[userId].map((ticket) => (
            <div key={ticket.id} className="User-ticket-card">
              <p id='UsertickedId'>{ticket.id}</p>
              <p style={{margin:"0px", marginBottom:"10px"}}>{ticket.status in icons ? (icons[ticket.status]):('')} {ticket.title.length>60 ? ticket.title.slice(0,61)+'...' : ticket.title}</p>
              <span style={{fontSize:"small"}}>{checkPriority(ticket.priority)}</span> <span className='UserticketText'><i class="fa-solid fa-circle fa-2xs" style={{"color": "#757575"}}></i> {ticket.tag[0]}</span>
            </div>
          ))}
        </div>
      ))}
    </div>
  );
};

export default ByUser;
